def min_cost(cost, m, n):
    dp = [[0] * (n + 1) for _ in range(m + 1)]
    for i in range(m + 1):
        for j in range(n + 1):
            if i == 0 and j == 0:
                dp[i][j] = cost[i][j]
            elif i == 0:
                dp[i][j] = dp[i][j - 1] + cost[i][j]
            elif j == 0:
                dp[i][j] = dp[i - 1][j] + cost[i][j]
            else:
                dp[i][j] = min(dp[i - 1][j], dp[i][j - 1]) + cost[i][j]
    return dp[m][n]

def is_not_prime(n):
    for i in range(2, n):
        if n % i == 0:
            return True
    return False

